import React, { useEffect, useState } from "react";
import { useParams, useNavigate } from "react-router-dom";
import { fetchProducts } from "../contentfulClient";
import { documentToReactComponents } from "@contentful/rich-text-react-renderer";

const Products = () => {
  const { id, lang } = useParams(); // Sub Category ID ve dil parametresini al
  const [products, setProducts] = useState([]); // Ürünleri tutacak state
  const [error, setError] = useState(null); // Hataları tutacak state
  const navigate = useNavigate();

  useEffect(() => {
    const getProducts = async () => {
      try {
        const fetchedProducts = await fetchProducts(id); // Sub Category ID'yi kullan
        console.log("Fetched Products: ", fetchedProducts); // Gelen ürünleri kontrol edin
        setProducts(fetchedProducts); // Gelen ürünleri state'e kaydet
      } catch (error) {
        console.error("Ürünler alınamadı:", error);
        setError("Ürünler alınırken bir hata oluştu.");
      }
    };

    getProducts(); // Ürünleri almak için fonksiyonu çağır
  }, [id]);


  return (
    <>
      <header className="relative h-screen">
        {/* Video Arka Plan */}
        <video
          className="absolute inset-0 w-full h-full object-cover"
          src={`${process.env.PUBLIC_URL}/EtaHeaderVideo2.mp4`}
          autoPlay
          loop
          muted
        ></video>
        {/* Transparan Siyah Katman */}
        <div className="absolute inset-0 bg-black bg-opacity-60"></div>

        {/* Header İçerik */}
        <nav className="absolute top-0 left-0 right-0 z-20 flex justify-between items-center px-6 py-4 md:px-10 bg-black bg-opacity-60">
          {/* Logo */}
          <div className="md:text-left text-center">
            <img
              src={`${process.env.PUBLIC_URL}/EtaLogo.png`}
              alt="Eta Logo"
              className="h-12 md:h-16 inline-block"
            />
          </div>

          {/* Hamburger Menü (Mobilde Görünür) */}
          <button
            className="text-white text-3xl md:hidden focus:outline-none"
          >
            ☰
          </button>

          {/* Menü */}
          <ul className="absolute top-28 left-0 right-0 bg-black bg-opacity-90 text-white md:static md:flex md:space-x-8 md:bg-transparent md:text-gray-300 md:items-center">
            <li className="hover:text-white cursor-pointer px-6 py-4 border-b border-gray-500 md:border-0">
              <a href={`/${lang}/header`}>HOME</a>
            </li>
            <li className="hover:text-white cursor-pointer px-6 py-4 border-b border-gray-500 md:border-0">
              SERVICES
            </li>
            <li className="hover:text-white cursor-pointer px-6 py-4 border-b border-gray-500 md:border-0">
              <a href={`/${lang}/projects`}>PROJECTS</a>
            </li>
            <li className="hover:text-white cursor-pointer px-6 py-4 border-b border-gray-500 md:border-0">
              CONNECT
            </li>
          </ul>
        </nav>

        {/* Ortadaki Metin */}
        <div className="absolute inset-0 flex flex-col justify-center z-10 text-white px-10">
          <div className="w-24 h-1 bg-red-500 mb-4 mt-24"></div>
          <h1 className="text-4xl md:text-6xl font-extrabold mb-6 leading-snug">
            <br /> PRODUCTS
          </h1>
        </div>
      </header>

      {/* Ürünler */}
      <section className="bg-white text-black py-16 px-10">
        <div className="max-w-7xl mx-auto">
          <h2 className="text-4xl md:text-5xl font-extrabold leading-snug mb-8">
            PRODUCTS
          </h2>
          {error && <p className="text-red-500">{error}</p>}
          <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
            {products.map((product) => (
              <div
                key={product.sys.id}
                className="bg-gray-100 shadow-md p-6 rounded-lg cursor-pointer"
                onClick={() => navigate(`/${lang}/product-details/${product.sys.id}`)} // Ürün detayına yönlendirme
              >
                {product.fields.product_image && product.fields.product_image.fields?.file?.url ? (
        <img
            src={product.fields.product_image.fields.file.url}
            alt={product.fields.product_name || "No Name"}
            className="w-full h-48 object-cover rounded-md mb-4"
        />
        ) : (
        <div className="w-full h-48 bg-gray-200 rounded-md mb-4 flex items-center justify-center">
            <span>No Image</span>
        </div>
        )}

                <h3 className="text-2xl font-bold mb-2">{product.fields.product_name || "No Name"}</h3>
                {product.fields.product_description && (
                  <div>
                    {documentToReactComponents(product.fields.product_description)} {/* RichText içerik */}
                  </div>
                )}
              </div>
            ))}
          </div>
        </div>
      </section>
    </>
  );
};

export default Products;
